[General]

; Reassign stereo samplers to unused registers to resolve some issues in this
; game where a surface will be displayed green in one eye and blue in the other
; from certain angles:
DefPSSampler = 15
; 260 is s3 in vertex shaders:
DefVSSampler = 260


; UseRenderedShaders=true is nearly always useful, because it trims the
; list of shaders seen while hunting down to just those active in the
; current scene.  Disable this only if you get crashes during hunting.
UseRenderedShaders=true

; DumpAll will generate ASM text files for every shader seen by the game.
; This is usually worth doing once, but not useful for every run.
DumpAll=true

; Less crashes when reloading shaders:
OverrideMethod = 2

; Unity games recently started using borderless window mode, so use a profile
; that supports 3D in a window. "3D-Hub Player" is pretty minimal:
GameProfile = fxdplayer

; Constant registers that will arrive in Vertex and Pixel Shaders, as c200.
DefVSConst1 = 200
DefPSConst1 = 200

; Mouse tends to stop working in Unity games (related to borderless window?):
InitMouse = false

; Force square surfaces (shadow maps) to be mono:
DefSquareSurfaceMode = 2

; Allow access to the view size in pixel shaders to calculate the pixel
; position on screen. This isn't usually necessary in the generic lighting fix,
; but sometimes a situation arises where it is necessary.
DefPSViewSizeConst = 210

; Fixes clipping at the edge of spot & point lights - common in Unity games.
SkipSetScissorRect = true

; The PresetKeysList specifies which KEYs will be used.
; Multiple keys lists are supported.
; Note that the KEY sections are in hexadecimal
PresetsKeysList = 0;1;

[KEY0]
; [ Selects a conservative convergence value of 0.03 so everything is behind
; the mask
Key = 219
Presets = 100;
Type = 1
[PRES100]
UseSepSettings = true
SaveSepSettings = true
Convergence = 0x3cf5c28f
[KEY1]
; ] selects a slightly higher convergence value of 0.1 for greater 3D effect
; with body only just outside of mask, but sometimes bubbles may come inside
; the mask.
Key = 221
Presets = 101;
Type = 1
[PRES101]
UseSepSettings = true
SaveSepSettings = true
Convergence = 0x3dcccccd
UseByDef = true

